  \"Autonomous Systems: Autonomous Cryogenic Loading Operations Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 15,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:24:47.540580\",\n\t\"name\": \"autonomous-systems-autonomous-cryogenic-loading-operations-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The main objectives are to develop
  and integrate Integrated Systems Health Management (ISHM) tools and component technologies
  into a seamless health management architecture and to create an autonomous cryogenic
  loading capability. ACLO components will be developed for mission-relevant cryogenic
  platforms/environment (i.e., ground-based and micro-g in-space capability) and demonstrated
  against the KSC Cryogenic Test Facility&amp;rsquo;s Simulated Propellant Loading
  System, a.k.a, the Cryogenic Testbed. The autonomous cryogenic loading capability
  and component technologies developed under the ACLO Project Element will be used
  to help mature concepts for variable levels of autonomy and will enable NASA to
  rapidly adapt to and support various launch concepts with multiple vehicle types
  in a multi-use launch pad or an in-space environment. The ACLO Project Element will
  continue to build on capabilities and concepts developed and/or demonstrated in
  FY13 under ACLO and previous ground autonomy and health management efforts:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Systems
  Autonomy Demonstration Program: Knowledge-based Autonomous Test Engineer (KATE),
  which proved the feasibility of using high-fidelity physics models and simulations
  to enable integrated system health, status and control for autonomous tank loading
  operations&lt;/li&gt;&lt;li&gt;Constellation pathfinder demonstrations and trade
  studies: Ares I-X Ground Diagnostic Prototype &amp;amp; Fault Detection, Isolation
  and Recovery Architecture Prototype, which developed a certifiable configuration
  and approach for integrated health management for ground and launch operations&lt;/li&gt;&lt;li&gt;AFRL
  Future Responsive Access to Space Technologies Program: Rapid Propellant Loading
  Project, which developed concepts for distributed launch operations and cryogenic
  loading operations using KATE and the Hybrid Diagnostic Engine&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\":
